@lynhhaaga and I have a new collection dropping this Friday for @la_femme_en_noir_. 

Made of breathable natural fabrics and other materials that perform well in hot climates. We wanted your aesthetic and style to not have to change as the temperatures rise. These pieces are comfortable, casual and easy to wear day to day. 

Dropping this Friday at 12 noon PST. 🖤 #lafemmeennoir #cottagewitch #gothicstyle

My heart hurts knowing I won’t see this beautiful wonderful human again.

@missgeorgiaoqueef was the real deal, one of those rare incredible people you only get lucky to find in a lifetime. She showed so much love and support to others and I feel incredibly lucky to have been one of those people. I tried to do the same in return over these last few years to her. 

I will cherish every moment, and conversation, and meme we shared. My love goes out to her family and husband over this immense loss of such a beautiful person. 🖤 #fuckcancer

Thank you everyone who watched our manic live stream and shopped our latest collection at @la_femme_en_noir_ !

@lynhhaaga spent the last 2 years making this Dracula collection possible, and with our teams support had a successful launch today. Shout out to our beautiful friend @blondiewood_ who modeled today. 

As a small female POC owned business we try and do wild creative things, only made possible with our customers support. 🖤
